import React from 'react';
import Footer from '../components/Footer';
import BoardListMain from '../components/BoardListMain';

const BoardList = () => {
  return (
    <div>
      <>
        <BoardListMain></BoardListMain>
        <Footer></Footer>
      </>
    </div>
  );
};

export default BoardList;
